import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  const [data, setData] = useState([
    {
      id: 1,
      title: "Inception",
      genre: "Science Fiction",
      publish: "2010-07-16",
    },
    {
      id: 2,
      title: "The Dark Knight",
      genre: "Action",
      publish: "2008-07-18",
    },
    {
      id: 3,
      title: "Parasite",
      genre: "Thriller",
      publish: "2019-05-30",
    },
    {
      id: 4,
      title: "La La Land",
      genre: "Musical",
      publish: "2016-12-09",
    },
    {
      id: 5,
      title: "Avatar",
      genre: "Science Fiction",
      publish: "2009-12-18",
    },
  ]);
  const [insert, setInsert] = useState({
    id: "",
    title: "",
    genre: "",
    publish: "",
  });

  return (
    <div className="container">
      <table className="contents">
        <tr>
          <td>ID</td>
          <td>제목</td>
          <td>장르</td>
          <td>출시일</td>
        </tr>
        {data.map((data, index) => {
          return (
            <tr>
              <td>{data.id}</td>
              <td>{data.title}</td>
              <td>{data.genre}</td>
              <td>{data.publish}</td>
            </tr>
          );
        })}
        <tr>
          <td colSpan={3}>
            <input type-="text" placeholder="아이디"/>
            <input type-="text" placeholder="제목"></input>
            <input type-="text" placeholder="장르"></input>
            <input type="date" ></input>
          </td>
          <td colSpan={1}>
            <button>추가</button>
          </td>
        </tr>
      </table>
    </div>
  );
}

export default App;
